import React, { useState , useContext } from 'react';

function DashBoard(props) {

  console.log(props.userData);
  
  return (
    <UserContext.Consumer>
      <div>
        <h1>관리자 페이지</h1>
        <h2>현재 접속 관리자 : {userData}</h2>

      </div>
      </UserContext.Consumer>
  )
}

export default DashBoard;
